import React from 'react';
import {Page, Text, View, Document, StyleSheet, Font, Image, Line} from '@react-pdf/renderer';
import Hall from "../../pages/event/hall";
import LogoTicket from "../../assets/LogoTicket.png";
import  helvetica from  "../../assets/Font/Helvetica/helvetica_regular.otf"
import {QRCode} from "antd";
Font.register({
    family: "Robot",
    src:
        "https://cdnjs.cloudflare.com/ajax/libs/ink/3.1.10/fonts/Roboto/roboto-light-webfont.ttf"
});
Font.register({
    family: "RobotBold",
    src:
        "https://cdnjs.cloudflare.com/ajax/libs/ink/3.1.10/fonts/Roboto/roboto-bold-webfont.ttf"
});
// Create styles

const styles = StyleSheet.create({
    body: {
        paddingTop: 35,
        paddingBottom: 65,
        paddingHorizontal: 35,
        fontFamily: "Robot"
    },
    page: {
        flexDirection: 'row',
        backgroundColor: '#E4E4E4',
        fontFamily: "Robot"
    },
    section: {
        margin: 10,
        padding: 10,
        flexGrow: 1
    },
    line: {
        marginTop: 20,
        marginBottom: 20,
        borderBottom: '1pt solid #391085'
    },
    logo: {
        width: 200,
        height: 2.36,
        marginTop: 40,
        marginBottom: 20,
        alignSelf: 'center'
    },
    textBold: {
        width: 200,
        height: 2.36,
        marginTop: 40,
        marginBottom: 20,
        alignSelf: 'center'
    }
});

const Ticket = () => {
    const src = 'https://createqr.ru/api/v1/qr-pay?Name=Иванов И. И';

    return (
        <Document>
            <Page orientation="landscape" size="A4" style={styles.page}>
                <View style={styles.section}>
                    <Text style={{ fontSize: 28 }}>Заголовок</Text>
                    <Line style={styles.line} />
                    <Text>Место: Rockstar Bar. ул. Пушкина, 29А</Text>
                    <Text>Дата и время: 25 сентября 20:01</Text>
                    <Text>Стоимость: 1 012 руб.</Text>
                    <Text style={{ fontSize: 14 }}>Категория: Танцпол</Text>
                    <Line style={styles.line} />
                    <Text style={{ fontSize: 12 }}>Электронный билет</Text>
                    <Text>Номер: 1231180948 / 44220189</Text>
                    <Text>Дата покупки: 20.09.2023 09:39</Text>
                    <Text>Выпущен на Merop</Text>
                </View>
                <View style={styles.section}>
                    <Image
                        cache={false}
                        src={src}
                        style={{ width: 3.5, height: 3.5 }}
                    />
                    <Text style={{ fontSize: 12 }}>Text</Text>
                    <Text>Как работает билет</Text>
                    <Text>По билету можно пройти только один раз,</Text>
                    <Text>его нельзя копировать и перепродавать.</Text>
                    <Text>Не выкладывайте билет в соцсети:</Text>
                    <Text>другой человек может использовать штрихкод и пройти вместо вас</Text>
                    <Text>Как работает билет</Text>
                    <Text>Как вернуть</Text>
                    <Text>Если событие отменят, заменят или перенесут или у вас просто не получается на него попасть</Text>
                    <Text>пишите на почту MeropsRoot@hotmail.com</Text>
                    <Text>Участники мероприятия обязаны</Text>
                    <Text>- соблюдать правила поведения в общественных местах;</Text>
                    <Text>- занимать места согласно купленному билету;</Text>
                    <Text>- сохранять билет до конца мероприятия и предъявлять по требованию администрации и сотрудников службы охраны.</Text>
                    <Image
                        cache={false}

                        src="LogoTicket"
                        style={styles.logo}
                    />
                </View>
            </Page>
        </Document>
    )
};

export default Ticket;
